script: |
  super -f text -I q3065.spq | sort > q3065.out

inputs:
  - name: q3065.spq
    data: |
      SELECT - col0 * - col1 + + col2 - + + col2 + col1 * 14 FROM tab1 (FORMAT parquet) WHERE col0 * + col2 * - 76 BETWEEN 63 AND + - 53 * col0;
  - name: tab1

outputs:
  - name: q3065.out
    data: |
